    private static class CubeRotatorRandom implements Runnable {
        private final Cube cube;
        private final int size;
        private final int multiply;

        public CubeRotatorRandom(Cube cube, int size, int multiply) {
            this.cube = cube;
            this.size = size;
            this.multiply = multiply;
        }

        public void run() {
            try {
                Random random = new Random();

                for (int i = 0; i < this.multiply; ++i) {
                    int randomSide = random.nextInt(6);
                    int randomLayer = random.nextInt(this.size);
                    this.cube.rotate(randomSide, randomLayer);
                }
            } catch (InterruptedException e) {
                System.out.println("Thread interrupted");
            }

        }
    }

    private static class CubeShower implements Runnable {
        private final Cube cube;
        private final int multiply;

        public CubeShower(Cube cube, int multiply) {
            this.cube = cube;
            this.multiply = multiply;
        }

        public void run() {
            try {
                for (int i = 0; i < this.multiply; ++i) {
                    this.cube.show();
                }
            } catch (InterruptedException ignored){

            }
        }
    }

    private static class CubeRotator implements Runnable {
        private final Cube cube;
        private final int side;
        private final int layer;
        private final int multiply;

        public CubeRotator(Cube cube, int side, int layer, int multiply) {
            this.cube = cube;

            this.side = side;
            this.layer = layer;
            this.multiply = multiply;
        }

        public void run() {
            try {
                for (int i = 0; i < this.multiply; ++i) {
                    this.cube.rotate(this.side, this.layer);
                }
            } catch (InterruptedException e) {

            }

        }
    }

    /*Funkcja pomocnicza do testu TestThreadSafety()*/
    private boolean checkIfCubeCorrect(Cube cube, int size) {
        try {
            String result = cube.show();
            int[] side = new int[SIDESNUM];

            for (int i = 0; i < result.length(); i++) {
                int temp = Character.getNumericValue(result.charAt(i));
                if (temp < SIDESNUM)
                    side[temp]++;
                else
                    return false;
            }
            for (int i = 0; i < SIDESNUM; i++) {
                if (side[i] != size * size)
                    return false;
            }
            return true;

        } catch (InterruptedException e) {
            System.out.println("Thread interrupted.");
            return false;
        }

    }

