    /*Funkcja testująca bezpieczeństwo podczas współbieżności, nie
    uwzględniając kolejności przeplotu*/
    @Test
    public void TestThreadSafety() {

        int CUBE_SIZE = 3;
        int MULTIPLY = 1000;

        Cube cube = new Cube(CUBE_SIZE,
                (x, y) -> {
                },
                (x, y) -> {
                },
                () -> {
                },
                () -> {
                }
        );

        Thread[] rotator = new Thread[THREADS_NUMBER];

        for (int i = 0; i < THREADS_NUMBER; i++) {
            rotator[i] = new Thread(new CubeRotatorRandom(cube, CUBE_SIZE,
                    MULTIPLY));
        }

        for (Thread thread : rotator) {
            thread.start();
        }

        for (Thread thread : rotator) {
            try {
                thread.join();
            } catch (InterruptedException x) {
                System.out.println("Thread interrupted.");
            }
        }


        assertTrue(checkIfCubeCorrect(cube, CUBE_SIZE));
    }

