    /*Test sprawdzający obsługę przerwań, sprawdza,
    czy przerwanie wpływa na inne wątki*/
    @RepeatedTest(10)
    public void TestException() {
        int CUBE_SIZE = 3;
        int multiply = 200;

        AtomicInteger runCounter1 = new AtomicInteger(0);
        AtomicInteger runCounter2 = new AtomicInteger(0);
        AtomicInteger showCounter1 = new AtomicInteger(0);
        AtomicInteger showCounter2 = new AtomicInteger(0);
        Cube cube = new Cube(CUBE_SIZE,
                (x, y) -> {
                    runCounter1.getAndIncrement();
                },
                (x, y) -> {
                    runCounter2.getAndIncrement();
                },
                showCounter1::getAndIncrement,
                showCounter2::getAndIncrement
        );

        Thread[] thread = new Thread[THREADS_NUMBER];
        Thread badThread = new Thread(new CubeShower(cube, 1));

        for (int i = 0; i < THREADS_NUMBER; i++) {
            thread[i] = new Thread(new CubeRotator(cube,
                    i % SIDESNUM, i % CUBE_SIZE, multiply));
        }
        for (int i = 0; i < THREADS_NUMBER; i++) {
            thread[i].start();
        }

        badThread.start();
        badThread.interrupt();

        for (int i = 0; i < THREADS_NUMBER; i++) {
            try {
                thread[i].join();
            } catch (InterruptedException ignored) {
                System.out.println("Thread interrupted");
            }
        }

        int expectedRun1 = THREADS_NUMBER * multiply;
        int expectedRun2 = THREADS_NUMBER * multiply;

        Assertions.assertEquals(0, showCounter1.get());
        Assertions.assertEquals(0, showCounter2.get());
        Assertions.assertEquals(expectedRun1, runCounter1.get());
        Assertions.assertEquals(expectedRun2, runCounter2.get());
        Assertions.assertEquals(runCounter1.get(), runCounter2.get());
    }
